"""
LeetCode :: May 2022 Challenge :: Remove All Adjacent Duplicates in String II
jramaswami
"""


class Item:
    def __init__(self, value):
        self.value = value
        self.freq = 1

    def __str__(self):
        return self.value * self.freq

    def __repr__(self):
        return f"({self.value} {self.freq})"
    

class Solution:
    def removeDuplicates(self, S: str, k: int) -> str:
        stack = []
        for c in S:
            if stack and stack[-1].freq == k:
                stack.pop()

            if stack:
                if c == stack[-1].value:
                    stack[-1].freq += 1
                else:
                    stack.append(Item(c))
            else:
                stack.append(Item(c))
        
        return "".join(str(t) for t in stack)
            

def test_1():
    s = "abcd"
    k = 2
    assert Solution().removeDuplicates(s, k) == "abcd"


def test_2():
    s = "deeedbbcccbdaa"
    k = 3
    assert Solution().removeDuplicates(s, k) == "aa"


def test_3():
    s = "pbbcggttciiippooaais"
    k = 2
    assert Solution().removeDuplicates(s, k) == "ps"


def test_4():
    "TLE"
    s = ""
    k = 10000
    result = Solution().removeDuplicates(s, k)
    assert result == ""


def test_5():
    "WA"
    s = "yfttttfbbbbnnnnffbgffffgbbbbgssssgthyyyy"
    k = 4
    assert Solution().removeDuplicates(s, k) == "ybth"